 @Mustafa-rs9kw  Söylediklerinize itirazım yok, fakat tabii Dünya o istikamete girerse. Çin'in yenilenebilir enerji yatırımları aslında 0 emisyon ambalajına büründürülmüş enerji bağımsızlığı politikası. İç kaynaklarını harcamaya geldiğinde kömürden elektrik üretmekten hiç çekinmiyorlar. 
Burada demek istediğim; Dünya sürekli kutuplaşırken ortak politikaları yürütmek imkansız. Mesela herkes biliyor ki mevcut nükleer silahlar bir ateşlense Dünya bir nükleer kış yaşar, ki bu neredeyse bütün canlılığın yok olması demek. Ve birisinin yapacağı hata, karşılıklı silahların ateşlenmesini kaçınılmaz kılar. Bu kadar büyük bir potansiyel felakete karşı ne yapılıyor mesela? Nato, Rusya ve Çin şu an eş zamanlı olarak yeniden bir nükleer silahlanma yarışına girdi. 
Bu tip kutuplaşmalar ortak hareket etmenin önüne geçip, ülkelerin birbirinin kafasına basarak yükselme yarışına girmesine sebep oluyor. Çok yakın bir geçmişte yapay zekanın askeri alanda kullanılması kabul edilmezken; bugün İsrail hükümeti yapay zeka ile hedef belirleyip yaptığı katliamlara yapay zekayı sorumlu tutuyor. Çin'de silahlı robotlar çoktan kameralar önünde test edilmeye başlandı bile. ABD hava filosunu yapay zeka kontollü avcı uçaklarla donatma projesi yürütüyor. Bir de Çin ile ekonomik savaş daha yüksek tonla dinlendirilmeye başlandığında kimsenin etik kurallara veya işçi haklarına dönüp bakacağına ihtimal vermiyorum.
